import React from "react";
import UserContext from "react";


class AllData extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        const ctx = React.useContext(UserContext);
        return (
            <>
            <h5>All Data in Store</h5>
            {JSON.stringify(ctx)}<br/>
            </>
        )
    }
}
export default AllData;
